import LatestRelease from '../components/LatestRelease'
import 'bootstrap/dist/css/bootstrap.min.css';


const Home = () => {
  return (
    <>
      <Navigation/>
      <Welcome/> 
      <LatestRelease/>
    {/*<Counter/>*/} 
